// import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

import Navbar from './components/web_components/Navbar'; // Import the new Navbar component
import Registration from './components/Auth/Registration';
import Login from './components/Auth/Login';
import Index from './components/web_components/Index';
import Crsls from './components/web_components/Crsls';
import Home from './components/web_components/Home'
function App() {
  return (
    <>
    <div className="App">
      <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Index/>} />
        <Route path="/register" element={<Registration />} />
        <Route path="/login" element={<Login />} />
      </Routes>
    </Router>
    </div>
    <div className="Crsls">
    <Crsls />
    </div>
    </>
  );
}

export default App;
